import React, { Component } from 'react'
import '../App.css'





export default class Navigation extends Component {
    constructor(props) {
        super(props)
    
        this.state = {
             show:true
        }
    }
    
    
    render() {
         const token = localStorage.getItem("token")
        return (
           <div className="nav">
               <ul className="nav__menu">
               <li className="nav__menu-item">
                     {/* <a><h1></h1></a> */}
                     <ul className="nav__submenu">
                         {token ? ( <li className="nav__submenu-item ">aaaaaaa</li>
                         ): (<li className="nav__submenu-item ">ccccccc</li>)}
                        
                         
                         
                         </ul>
               </li>
               </ul>
           </div>
        )
    }
}
